sys_variable_value.value:
(function execute(inputs, outputs) {

  if(inputs.status == 200){

    var reservtionDetails=JSON.parse(inputs.responseBody);
    outputs.status = "Success";

    outputs.addressid = reservtionDetails.address_id;
    outputs.scopegroupid = reservtionDetails.scope_group_id;
    outputs.id = reservtionDetails.id;

    for (var i=0; i< reservtionDetails.options.length; i++) {

      if(reservtionDetails.options[i].name == "dhcpv4/domain-name"){
        if(reservtionDetails.options[i].value != ""){
          outputs.domainname = reservtionDetails.options[i].value;
        }
      }
      if(reservtionDetails.options[i].name == "dhcpv4/host-name"){
        if(reservtionDetails.options[i].value != ""){
          outputs.hostname = reservtionDetails.options[i].value;
        }
      }
    }

    // outputs.ReservationResponse = JSON.parse(inputs.responseBody);

  } else {
    outputs.status= "Error";
    outputs.errormessage = new NSOneErrorHandler().dhcpErrorHandler(inputs, outputs).error_message;
  }

})(inputs, outputs);

